  input: '"TEXT","F3A","C00301838","November 5, 2002    Federal Election Commission  Reports
    Analysis Division  Attn: Chris Jones  Washington, D.C. 20463    Dear Mr. Jones:    This
    letter is in response to the Federal Election Commissions request that Steve Chabot
    for Congress provide additio-  nal information for the Year End Report (10/1/05-12/31/05).  It
    is our understanding that in order to comply with your request we   must present
    the FEC with any additional information our committee received concerning individual
    contributors,   or demonstrate that best efforts have been used to obtain this
    information.    Upon solicitation of a contribution, our committee clearly states
    that federal law requires political committees to   report the name, mailing address,
    occupation and name of employer for each individual whose contributions   aggregate
    in excess of $200 and we request that information from each contributor.  If that
    information is not   provided, our committee will make at least one follow up
    effort to request this information.  This is done by mailing  a letter, no later
    than thirty days after the contribution was received, enclosed with a pre-addressed
    envelope  to the contributor requesting that additional information be provided
    so that we may comply with federal regulations.  If the committee still does not
    receive the contributor information, we will attempt to reach the contributor
    by   phone, or if no phone number is available, mail another letter requesting
    the required information.  At this   time, our committee will file an amendment
    to provide additional contributor information provided to our   committee for
    the requested period.    If you have any questions, please contact Mike Cantwell
    at 513-481-9998.      Sincerely,    Mike Cantwell  Campaign Finance Manager"'
